@Test
    public void testPrintFullAddressInBangkok() throws Exception {
        assertEquals("แขวงสนามบิน เขตดอนเมือง กรุงเทพมหานคร",
                     AddressPrinter.printFull("สนามบิน", "ดอนเมือง", "กรุงเทพมหานคร"));
    }

